import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import SeriesPage from './pages/SeriesPage';

const App: React.FC = () => {
  return (
    <Router>
      <Navbar /> {/* Navbar tüm sayfalar için sabit */}
      <Routes>
        <Route path="/" element={<h1>Ana Sayfa</h1>} /> {/* Ana sayfa */}
        <Route path="/diziler" element={<SeriesPage />} /> {/* Diziler sayfası */}
      </Routes>
    </Router>
  );
};

export default App;
